    actionPromise(
      "ordersFind",
      gql(
        "http://shop-roles.node.ed.asmer.org.ua/graphql",
        `query orders($q: String) {
            OrderFind(query: $q) {
                orderGoods{good {
                _id
                createdAt
                name
