                price
                }},owner {
                _id
                createdAt
                login
                nick
                }
                total
                _id
            }
            }`,
        { q: JSON.stringify([{}]) }
      )
    )
  );
  const AdminOrdersList = connect((state) => ({
    orders: state.promise.ordersFind.payload,
  }))(AdminOrderInfo);
    return (
      <>
      <div>hi</div>
        <AdminOrdersList />
      </>
    );
}
export default AdminOrders;
